import React from 'react';
import "./imageLinkForm.css";

const ImageLinkForm = ({onInputChange}) => {
	return (
			  <div>
				  <p className='f3 white'>
				  	{'This AI will detect faces in your pictures. Pleas try.'}
				  </p>
				  
			  	  <div className='center'>
			  	  	<div className='form pa4 br4 shadow-5 center'>
					  <input onChange={onInputChange} className='f4 pa2 w-70 center' type='text' id='fname' name='fname' />
					  <button onClick={onInputChange} className='w-30 grow f4 link ph3 pv2 dib white bg-light-purple' type='submit' value='Submit'>Detect</button>
			      	</div>
			      </div>
			  </div>

	)
}

export default ImageLinkForm;
